import React from 'react';
import './App.css';

export default class App extends React.Component {
  state = {
    add: 'add',
    addText: <i class='far fa-arrow-alt-circle-left'></i>,
    delText: <i class='far fa-arrow-alt-circle-right'></i>,
    addClass: false,
    delClass: false,
    pageTitle: 'privet',
  };

  changeInput = (event) => {
    this.setState({
      pageTitle: event.target.value,
    });
  };

  listDone = (e) => {
    e.stopPropagation();
    this.setState(({ addClass }) => {
      return {
        addClass: !addClass,
      };
    });
  };

  listDel = () => {
    this.setState(({ delClass }) => {
      return {
        delClass: !delClass,
      };
    });
  };

  render() {
    const { add, addText, delText, delClass, addClass, pageTitle } = this.state;

    return <div className='App'></div>;
  }
}
